Antonio Lucio Vivaldi (Italian: [anÃ‹Ë†tÃ‰â€Ã‹ï¿½njo Ã‹Ë†luÃ‹ï¿½tÃŠÆ’o viÃ‹Ë†valdi]; 4 March 1678 Ã¢â‚¬â€œ 28 July 1741), nicknamed il Prete Rosso (&quot;The Red Priest&quot;) because of his red hair, was an Italian Baroque composer, Catholic priest, and virtuoso violinist, born in Venice. Recognized as one of the greatest Baroque composers, his influence during his lifetime was widespread over Europe. Vivaldi is known mainly for composing instrumental concertos, especially for the violin, as well as sacred choral works and over forty operas. His best known work is a series of violin concertos known as The Four Seasons.
